 - Oktober. LineUp Narayafest season 3 terdiri dari AfterShine , The Changcuters , NDX AKA , Vierratale dan juga masih Ada Mistery Guest Star yang tentunya akan menambah vibes Spektakuler event di Narayafest season 3 ini.',110000,12,69000,7,100000,200,4,0,0,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(9,'MUSIC OF GENERATION',3274,'Jl. Brigjend Dharsono, Korem 063/Sunan Gunung Jati',1,'2023-09-01',NULL,'15:00:00','22:00:00','“MUSIC OF GENERATION” adalah serangkaian kegiatan yang diselenggarakan D’tONes Pro Organizer untuk menghibur Masyarakat dengan beberapa konten diantaranya adalah Bazar UMKM dan Musik Entertainment bekerjasama dengan Beberapa Artist dan Band Guna membangun dan membangkitkan semangat Masyarakat pecinta musik.',110000,12,69000,8,100000,200,5,0,0,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(10,'Muntuk Gayeng Fest',3471,'Lapangan Sepak Bola Muntuk - Bantul',1,'2023-08-14','2023-08-14','17:00:00','22:00:00','Yuk siapkan hati dan pikiran kamu untuk menikmati serunya nonton konser Aftershine di temani dengan nuansa desa yang pastinya akan menambah suasana menjadi lebih indah di kota kesayangan kita yaitu Yogyakarta. Muntuk Gayeng akan hadir pada tanggal 5 Agustus 2023 di Lapangan Sepak Bola Muntuk. Jangan lewatkan kesempatan ini untuk menikmati serunya nonton konser di suasana desa dengan orang tersayang. Dapatkan tiketmu sekarang juga ya !!!',150000,12,80000,8,100000,200,7,0,0,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(11,'Carasel Celestia',3171,'Gambir Expo - Arena PRJ Kemayoran',1,'2023-10-20',NULL,'14:30:00','21:30:00','CARASEL (Cipta Karya Seni Enam Lapan) merupakan sebuah pentas seni yang diselenggarakan oleh SMAN 68 Jakarta. Pentas seni tahun ini bertajuk CARASEL CELESTIA dengan mengangkat sebuah Cҽɾιƚα Lҽʅαɳα Sυαɾα Eυϝσɾια. Sama seperti tahun sebelumnya, ??????? ???????? akan diramaikan oleh berbagai penampilan dari murid SMA 68 Jakarta hingga para ????? ???? yang selalu meriah dengan suaranya yang membawa kegembiraan kepada Punggawan. ??????? ???????? akan hadir pada tanggal ?? ??????? ???? ?????? ?????? ?????????.',130000,12,100000,8,100000,200,8,0,0,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(12,'Chemistry Art Festival#9',3471,'GOR Lembah UGM',1,'2023-10-20',NULL,'18:30:00','21:30:00','Chemistry Art Festival#9 adalah event musik yang diselenggarakan oleh Himpunan Mahasiswa Kimia FMIPA UNY. Tahun ini CAF#9 bertemakan Germanium Rhythmical yang berarti paduan antara suatu unsur dari kimia dan unsur di dalam musik. CAF#9 akan hadir menemani teman-teman semua dengan keseruan acaranya dan ditemani oleh Guest Star yang sangat spektakuler yaitu Aftershine dan Guest Star Nasional lainnya yang akan berdendang bersama di panggung Chemistry Art Festival# 9. Stay tuned and grab your ticket now!',205000,11,140000,8,100000,200,9,0,0,'2023-07-31 00:00:00','2023-09-10 15:39:50'),(13,'START FEST 2023',3471,'Parkiran Stadion Mandala Krida',1,'2023-10-20',NULL,'15:30:00','20:00:00','Merupakan sebuah event yang di selengarakan oleh BEM FISIP UPN “VETERAN” Yogyakarta. Event ini merupakan serangkaian kegiatan yang terdiri dari 2 sub event yaitu FISIP Olympic dan FISIP Festival. START.Fest 2023 kali ini mengusung tema “Hawaiian Summer Party : Circle Of Youth”',110000,12,69000,8,100000,200,10,0,0,'2023-07-31 00:00:00','2023-09-10 15:39:50'),(14,'Night on the Museum',3273,'Museum Geology',10,'2023-10-22',NULL,'18:00:00','21:00:00','Berpetualang di museum malam hari dengan minim cahaya',NULL,NULL,10000,200,100000,200,1,1,1,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(15,'Galaxy Job Fair',3273,'undefined',11,'2023-10-22',NULL,'09:00:00','16:00:00','Perluas network-mu, kejar mimpimu!',NULL,NULL,NULL,NULL,100000,200,2,1,0,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(16,'Old Dummy Event',3273,'undefined',11,'2023-07-22',NULL,'09:00:00','16:00:00','Perluas network-mu, kejar mimpimu!',NULL,NULL,NULL,NULL,100000,200,2,1,0,'2023-07-31 17:00:00','2023-09-10 15:39:50'),(17,'BERKAH COMPUTER',3171,'Jakarta',2,'2023-08-11','2023-08-13